import { useRouter } from 'next/router'
import Link from 'next/link';
import React, {useEffect, useState} from "react";
import fetch from "node-fetch";
import useSWR from "swr";
import { makeStyles } from '@material-ui/core/styles';
import EditIcon from '@material-ui/icons/Edit';
import AddIcon from '@material-ui/icons/Add'

import {
    TableHead,
    TableCell,
    TableContainer,
    TableBody,
    Paper,
    TableRow,
    Table,
    IconButton,
    Fab
} from "@material-ui/core";

const useStyles = makeStyles(theme=>({
   table:{
       padding:"5%"
   },
    addButton:{
       position:"relative",
       margin:theme.spacing(2)
    }
}));

function Mistnosti(props) {

    let [tableData,setTableData] = useState([]);

    const classes = useStyles();
    const order = props.query.order;
    const router = useRouter();
    let edit = props.edit;

    function checkStatus(res) {
        if (res.ok) { // res.status >= 200 && res.status < 300
            return res;
        } else {
            return {json:()=>{return{error:res.status}}}
        }
    }

    /*const fetcher = async (path) => {
        const data = await fetch(path,{method:'GET',headers: {AUTHTOKEN: props.session}}).then(checkStatus);
        const json = await data.json();

        return json;
    };*/

    let fetchdata;

    /*let requestData = (order=undefined) => {
        let orderstring = "";
        if(order!==undefined)
            orderstring = "?order="+order;

        const {data, error} = useSWR('http://localhost:3000/api/getrooms'+orderstring, fetcher)
        fetchdata = data;
        fetcherror = error;
    }*/


    //requestData(order);

    useEffect(()=>{

        if(props.session==null)
            router.push("/login");

        let orderstring = "";
        if(order!==undefined)
            orderstring = "?order="+order;

        fetch("http://a2017sedlja.delta-studenti.cz/projektAPI/mistnosti.php"+orderstring,{method:'GET',headers: {AUTHTOKEN: props.session}}).then(checkStatus).then(d=>d.json()).then(j => {
            fetchdata = j;

            if(!fetchdata){
                //setTableData(["loading"]);
            } else if(fetchdata.error) {
                //setTableData([{"error":fetchdata.error}]);
            } else {
                setTableData(fetchdata);
            }
        });
    },[props.session,props.query.order]);

    return (
        <div>
            <div className={classes.table}>
            <TableContainer component={Paper}>
                <Table>
                <TableHead>
                    <TableCell >ID</TableCell>
                    <Link href={{ pathname: '/mistnosti', query: { order: order==="name_asc"?"name_desc":"name_asc" } }}>
                    <TableCell align="right">Název</TableCell>
                    </Link>
                    <Link href={{ pathname: '/mistnosti', query: { order: order==="phone_asc"?"phone_desc":"phone_asc" } }}>
                    <TableCell align="right">Telefon</TableCell>
                    </Link>
                    <Link href={{ pathname: '/mistnosti', query: { order: order==="num_asc"?"num_desc":"num_asc" } }}>
                    <TableCell align="right">Číslo</TableCell>
                    </Link>
                </TableHead>
                <TableBody>
                    {
                        tableData.map(row=>(
                            <TableRow>
                                <TableCell>
                                    {row[3]}
                                </TableCell>
                                <TableCell align="right">{row[1]}</TableCell>
                                <TableCell align="right">{row[2]}</TableCell>
                                <TableCell align="right">{row[0]}</TableCell>
                                {props.edit == 1 ?
                                    <TableCell padding="checkbox">
                                        <Link href={"/editRoom?id="+row[3]}>
                                        <IconButton color="secondary" aria-label="edit">
                                            <EditIcon />
                                        </IconButton>
                                        </Link>
                                    </TableCell>
                                    : null}
                            </TableRow>
                        ))
                    }
                </TableBody>
                </Table>
            </TableContainer>
                {props.edit == 1 ?
                <Link href={"/addRoom"}>
                <Fab color="primary" className={classes.addButton} aria-label="add">
                    <AddIcon />
                </Fab>
                </Link>:null}
            </div>
            <p>Hello Next.js</p>
        </div>
    );
}

Mistnosti.getInitialProps = (cont) => {
    return {query:cont.query}
}

export default Mistnosti;
